import React from "react";
import { URLUpload, Statistic, Card } from "../../components";
import "./StatisticsSection.style.css";

function StatisticsSection() {
  return (
    <div
      style={{
        flex: 1,
        marginTop: 45,
      }}
    >
      <div className="statisticsContainer">
        <URLUpload />
        <Statistic />
        <Card />
      </div>
    </div>
  );
}

export default StatisticsSection;
